import logo from './logo.svg';
import './App.css';
import { FaPlus, FaShare } from "react-icons/fa";
function App() {
  return (
    <div className="wrapper">
      <Card
        img='\Customer Engagementfirst_img.png'
      />
    </div>
  );
}
function Card(props) {
  return (
    <div className='card'>
      <div className='card_body'>
        <img src={props.img} />
        <p className='card_title'>
        {}
        </p>
        <p className='card_title'>Get your own mobile app for industry specific</p>
        <p className='card_price'>
          100 DTSU*
        </p>
        <FaPlus className='icon' /><FaShare className='icon' />
      </div>
    </div>
  );
}
export default Card;
